import style from "./home.module.scss"
import clsx from "clsx"
import { Profiler, useEffect, useState } from "react"

export default function Product() {
  const [product, setProduct] = useState(null)
  useEffect(() => {
    fetch("https://fakestoreapi.com/products")
      .then((res) => res.json())
      .then((json) => setProduct(json));
  }, [])
  return (
    <div className={clsx(style.products, 'grid', 'wide')}>
      <h1 className={clsx(style.heading)}>featured</h1>
      <div className={clsx('row')}>
        {product.map((item, index) => {
          const { id, title, price, description, category, image } = item
          return (
            <div className={clsx(style.product,'col', 'l-3')} key={id}>
              <img className={clsx(style.img)} src={image} />
              <h3 className={clsx(style.title)} >{title}</h3>
              <p className={clsx(style.price)} >{price}</p>
            </div>
          )})}
      </div>
    </div>
  )
}
